export default function Formulario() {

    function data(fromData){
        const name=fromData.get("name");
        alert({name});
    }
    return (
        <div className="container-fluid mt-5"> 
            <section>
                <h2>fomulario</h2>
                <form className="card border-primary mb-3" action={data}>
                    <div className='p-5 '>
                        <div className='form-group '>
                            <label  className="col-sm-2 col-form-label" for='InpNombre'>Nombre:</label>
                            <input class='inpNombre'  name="name" type='text' className='form-control' placeholder='Ingrese su nombre' />
                        </div>

                        <div className='form-group'>
                            <label className="col-sm-2 col-form-label" for="inpTel">numero de telefono:</label>
                            <input class="inpTel" type='number' className='form-control' placeholder='Ingrese su numero de telefono' />
                        </div>

                        <div className='form-group'>
                            <button type="submit" className="btn btn-info">subir</button>
                        </div>
                    </div>
                </form>
            </section>
        </div>
    );
}
